import React from 'react';
import Login from './component/Login/Login'
import './App.css'
import Users from './component/Users/Users'
import {Link,Switch,Route,Router} from 'react-router-dom'

function App() {
  return (
    <Router>
      <div className="App">
        <Route exact path="/" component={Login}/>
      </div>
    </Router>
  );
}

export default App;
